rgenic regions", ["Fraction of sequenced reads that map uniquely to an intergenic region of the genome."]], ["Reads mapped confidently to intronic regions", ["Fraction of sequenced reads that map uniquely to an intronic region of the genome."]], ["Reads mapped confidently to exonic regions", ["Fraction of sequenced reads that map uniquely to an exonic region of the genome."]], ["Reads mapped confidently to transcriptome", ["Fraction of sequenced reads that map to a unique gene, on the same strand as the gene, with a mapping quality = 255. In the default mode the transcriptome includes intronic alignments. When --gex-exclude-introns is used the transcriptome is restricted to alignments that are consistent with annotated splice junctions. Note that transcriptomic reads include reads designated as UMI counts, reads marked as duplicates, and reads that arise from low-support molecules."]], ["Reads mapped antisense to gene", ["Fraction of reads that map to the transcriptome with MAPQ 255, but on the opposite strand of one or more overlapping annotated genes. These reads are consistent with annotated splice junctions and do not align in the sense orientation with any overlapping genes."]]]}, "atac_mapping_table": {"rows": [["Confidently mapped read pairs", "85.9%"], ["Unmapped read pairs", "1.9%"], ["Non-nuclear read pairs", "2.8%"]]}, "atac_mapping_helptext": {"title": "Mapping", "data": [["Confidently mapped read pairs", ["Fraction of sequenced read pairs with mapping quality > 30"]], ["Unmapped read pairs", ["Fraction of sequenced read pairs that have a valid barcode but could not be mapped to the genome"]], ["Non-nuclear read pairs", ["Fraction of sequenced read pairs that have a valid barcode and map to non-nuclear genome contigs, including mitochondria,with mapping quality > 30."]], ["Plots", ["(right) Insert size distribution in linear scale."]]]}, "atac_targeting_table": {"rows": [["Number of peaks", "101,169"], ["Fraction of genome in peaks", "2.8%"], ["TSS enric
